import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <nav className="bg-blue-600 p-4 text-white flex gap-4">
      <Link to="/">Home</Link>
      <Link to="/buy">Buy</Link>
      <Link to="/rent">Rent</Link>
      <Link to="/sell">Sell</Link>
    </nav>
  );
};

export default Header;
